import React from 'react'

const Gallery = () => {

  return (
   

    function Leaderboard() {
      const [winners, setWinners] =([
        { id: 1, name: 'John Doe', score: 100 },
        { id: 2, name: 'Jane Doe', score: 90 },
        { id: 3, name: 'Bob Smith', score: 80 },
        { id: 4, name: 'Alice Johnson', score: 70 },
        { id: 5, name: 'Mike Williams', score: 60 },
      ]);
    
      return (
        <div>
          <h2>Leaderboard of Winners</h2>
          <table>
            <thead>
              <tr>
                <th>Rank</th>
                <th>Name</th>
                <th>Score</th>
              </tr>
            </thead>
            <tbody>
              {winners.map((winner, index) => (
                <tr key={winner.id}>
                  <td>{index + 1}</td>
                  <td>{winner.name}</td>
                  <td>{winner.score}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      );
    }
    

    


  )
}

export default Leaderboard
